import React, { useEffect } from "react";
import './Graph.css';
import '../../jquery-loader';
import ReactFlot from "react-flot";

function Graph(props) {

    const data = [[0, 3], [4, 8], [8, 5], [9, 13]];

    const options = {yaxis: {max: 9}, xaxis: {max: 13}}

    return (
        <ReactFlot id="product-chart" data={data} options={options} width="50%" height="100px" />
      );

}

export default Graph;
